import Helper from './Helper';

export default class Add extends Helper {
  add() {
    const sum = this.randomTwoNums();
    const result = sum[0] + sum[1];
    Helper.arr = [];

    Helper.tempArr = [result + 10, result - 10];
    const nearAnswer = this.randomTwoNums();

    console.log(sum);
    console.log(result);
    console.log(nearAnswer);

    // return sum;
  }
}
